import React from 'react';

const NavBar = () => {
  return (
    <div className='Nav'>
      <div className='title'>
        <h2>Andrew Makris Portfolio</h2>
        <hr />
      </div>
      <br />
      <div className='bar'>
        <h4>Professional Experience & Certifications</h4>
        <h4>Technical Skills & Tools</h4>
        <h4>Projects & Case Studies</h4>
        <h4>Problem-Solving & Risk Management</h4>
        <h4>Continuous Learning & Personal Development</h4>
      </div>
    </div>
  );
};

export default NavBar;
